    "        #print(n_next, ind_, Next)\n",
    "        q.append(n_next)\n",
    "        \n",
    "    if (0<=y - 1<=2):\n",
    "        n_next = Next.copy()\n",
    "        n_next[(x)+(y-1)*3],n_next[ind_] = n_next[ind_],n_next[(x)+(y-1)*3]\n",
    "        #print(n_next, ind_, Next)\n",
    "        q.append(n_next)\n",
    "        \n",
    "    if (0<=y + 1<=2):\n",
    "        n_next = Next.copy()\n",
